import React from 'react';
import { Rating } from 'react-native-ratings';

function PersonRates(){
  return(
    <div>

    <Rating
      showRating
      onFinishRating={this.ratingCompleted}
      style={{ paddingVertical: 5 }}
    />
    </div>
  )
}
export default PersonRates
